import * as React from 'react';
import "../styles/style.css"

class Noticia extends React.PureComponent{

  render() {
    return(
      <div className={"news"}>
          <h1>Mulher é presa em flagrante com cédulas falsas compradas na internet, diz PF</h1>
      </div>
    )
  }
}

export default Noticia;
